import { createApp } from 'vue';
import App from './App.vue';
import router from './routes/route.js';
import Vue from 'vue'
import Vuex from 'vuex'
import auth from './modules/auth'

Vue.use(Vuex)

export default new Vuex.Store({
  modules: {
    auth
  }
})

const app = createApp(App);
app.use(store); 
app.use(router); 
app.mount('#app');
